import React, { useEffect, useState } from 'react';
import { getData } from '../Firebase/firebase/functions';

function App() {
  const [todos, setTodos] = useState([1, 2, 3, 4]);
  const fetchData = async () => {
    const data = await getData();
    setTodos(data);
    console.log(todos);
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>Todos:</h1>
      <ul>
        {todos.map(todo => (
          <li>{todo.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
